import React from "react";

const Navbar = () => {
    return (
        <nav className="navbar">
            <div className="nav-link"><a href="">Profile</a></div>
            <div className="nav-link"><a href="">Messages</a></div>
            <div className="nav-link"><a href="">News</a></div>
            <div className="nav-link"><a href="">Music</a></div>
            <div className="nav-link"><a href="">Settings</a></div>
        </nav>


    );
}


export default Navbar;
